# Loop over input items and add a new field called 'myNewField' to the JSON of each one

loop = {
  'WEEK_TAG' : [1,2,3],
  'INOUT_TAG' : [1,2],
}

new_items = []

for item in _input.all():
  for week in loop['WEEK_TAG']:
    for inout in loop['INOUT_TAG']:
      tmp = dict(item.json)
      tmp['WEEK'] = week
      tmp['INOUT'] = inout
      new_items.append(tmp)

return new_items
